import React from "react";
import { Headc,Description, SuperSubgrid1 } from "./Webdevelopment.element";

function Component_development(props) {
  return (
    <SuperSubgrid1>
    <img src={props.image}></img>
    <Headc>
    {props.head}</Headc>
    <Description>
{props.description}
    </Description>
</SuperSubgrid1 >
  );
}

export default Component_development;
